(14383, 10014, 0, 1, 'LOVE', '一首表達深情鄉村男子\r\n\r\n慘遭外國ABC虧走女朋友\r\n\r\n的心裡話', '0000-00-00 00:00:00', 0000, 0, 1, 10, '       The day I walked on the street in my Campus\r\n                                                                                \r\n       I heard a song\r\n                                                                                \r\n       A handsome guy sang a song on stage\r\n                                                                                \r\n       A lot of Girls are Crazy For Him\r\n                                                                                \r\n                                                                                \r\n       But i can''t speak in English\r\n                                                                                \r\n       and i can''t understand it\r\n                                                                                \r\n       the only three words i know\r\n                                                                                \r\n       is   I   LOVE    U\r\n                                                                                \r\n                                                                                \r\n       I LOVE U I LOVE U I LOVE U\r\n                                                                                \r\n       I Only Know\r\n\r\n       I LOVE U I LOVE U I LOVE U\r\n                                                                                \r\n       I Only Know\r\n                                                                                \r\n       I LOVE U I LOVE U I LOVE U\r\n                                                                                \r\n       I Only Know\r\n                                                                                \r\n       I LOVE U I LOVE U I LOVE U\r\n                                                                                \r\n                                                                                \r\n       Tell me Why Girl\r\n                                                                                \r\n      you don''t love me anymore\r\n                                                                                \r\n      why don''t you love me baby\r\n                                                                                \r\n      you love ABC\r\n                                                                                \r\n       Tell me Why Girl\r\n                                                                                \r\n      you leave me along\r\n                                                                                \r\n      my heart is breaken now\r\n                                                                                \r\n      just wanna sing a song\r\n                                                                                \r\n      I LOVE U I LOVE U I LOVE U\r\n                                                                                \r\n      I LOVE U I LOVE U I LOVE U\r\n                                                                                \r\n                                                                                \r\n      and then I picked up my guuitar\r\n                                                                                \r\n      try to sing like Beatles\r\n                                                                                \r\n      the moment  the words came from my month\r\n                                                                                \r\n      they gave me a smile and say\r\n                                                                                \r\n      你乾ㄟ當邱歹意!?  喔\r\n                                                                         ', '', 298, '', '甜殺', '甜殺', 'Wave85', '', '', 0, 1, 0, '2009-02-06 03:39:16', '2015-03-12 13:37:50', '0000-00-00 00:00:00'),
