(14385, 10026, 1590, 1, '夜上海', '《夜上海》——马天宇09年转型之作\r\n用歌声温暖你的怀抱\r\n最受欢迎歌手马天宇变身英伦王子      《夜上海》勾画爱情故事', '2009-02-06 00:00:00', 0000, 0, 2, 7, '夜上海\r\n词曲：卿锋\r\n\r\n\r\n走 \r\n下一道街\r\n下一个出口\r\n下一瞬间\r\n\r\n我默默地找\r\n下一个梦\r\n下一个彩虹\r\n下一个人 \r\n\r\n她是否会爱我\r\n也象我一样迷失\r\n\r\n夜上海\r\n走失许多情人\r\n听见许多情歌\r\n流失许多体温\r\n故事刚刚开始 \r\n有人却要放弃\r\n有人拼命继续\r\n而我要去哪里\r\n才遇见幸福\r\n\r\n我还在寻找\r\n下一个梦\r\n下一个触碰\r\n下一盏灯\r\n\r\n它是否点亮我\r\n能让我不再迷失\r\n\r\n夜上海\r\n走失许多情人\r\n听见许多情歌\r\n流失许多体温\r\n故事刚刚开始 \r\n有人却要放弃\r\n有人拼命继续\r\n而我要去哪里\r\n才遇见幸福\r\n\r\n夜上海\r\n谁是我的情人\r\n谁唱我的情歌\r\n交换我的体温\r\n故事不会结束 \r\n有人学会领悟\r\n有人说很残酷 \r\n我甩开了脚步\r\n继续着旅途', '', 248, '', '卿锋', '卿锋', '', '', '', 0, 0, 0, '2009-02-06 15:43:29', '2015-03-12 13:37:50', '0000-00-00 00:00:00'),
(14386, 181, 0, 1, '妳是我的花朵 - (KS Remix) [You are my flowers - (KS Remix)]', 'KS接到以前高中同學來的一通電話，表示希望KS幫忙將（伍佰）的一首歌曲（妳是我的花朵）改編舞曲！KS毫不猶豫的一口答應了朋友得請求。經過電話那一頭描述後…他希望做出來的歌曲只有副歌“不斷重複播放”希望能將音樂“台”式化且兩天內完成！但KS想法卻覺得只有副歌不斷的在歌曲裡打轉？不覺得整首讓然很膩的感覺？台式化後難道聽的人不會翻肚？表示之後…意外的發現原來現在的人似乎不要求歌曲品質只要求馬上的高潮！這讓人聯想到在舞廳那些拿藥丸的小孩吞了之後的意思很雷同…那些ＤＪ在台上放的音樂給台下的人舞動身體似乎醉翁之意不在酒。如此一來給人們得印象卻是這樣的想法，當然也不能說所有的人都是如此…\r\n了解之後是他們公司為了要提振士氣所需要的一個概念並且還要帶上動作！委託人全權還是交給KS來作主，KS還是認為馬上讓人提振士氣的音樂舞曲會不會員工過度操勞！這就不得而知…如果你是他們公司的一員你覺得呢？\r\n\r\n在委託人的要求之下且兩天之內，把音樂作到符合他們的感覺確實有點難度，出來的成品可能會不是這麼入耳，還好KS的勸說之下委託人還是將主導權給KS，盡可能再只有副歌情況下做出屬於KS的風格並加點台式風味…\r\n\r\n作品年份：2007', '2011-05-05 00:00:00', 0000, 16, 0, 3, '', '', 585, '', 'KS (Kevin Su)', '伍佰', 'KS (Kevin Su)', '凱斯音樂', '', 0, 1, 0, '2009-02-06 15:53:23', '2015-03-12 13:37:50', '0000-00-00 00:00:00'),
